import React, { Component } from 'react';
import { ModalOpener } from './modalOpener';


export class NavegationButton extends Component {
    myForm = () => {
        return (
            <nav>
                {/*Deberán aparecer los links hacia el resto de las páginas*/}
                <a href='www.google.com.ar'>Egreso de tareas</a>
                <a href='www.google.com.ar'>Ingreso de tareas</a>
                <a href='www.google.com.ar'>Talleres</a>
                <a href='www.google.com.ar'>Resumen de tareas</a>
            </nav>
        );
    }

    render() {
        return (
            <ModalOpener buttonText='Navegación' children={this.myForm()} />
        );
    }
}
